eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"biographyEN\": () => (/* binding */ biographyEN),\n/* harmony export */   \"biographyPL\": () => (/* binding */ biographyPL)\n/* harmony export */ });\nconst biographyEN = [\n    `Antonio García Mulet: Fullness of Life, Art as a Reflection of Existence`,\n    `Antonio García Mulet, an artist born on November 17, 1932 in Barcelona, ​​is an extraordinary figure in the history of contemporary art. His biography, complex and full of fascinating stages, is like an open book whose pages illustrate not only his artistic evolution, but also his deep philosophy of life. Mulet's works not only reflect his personal reflections, but also contain delicate comments on contemporary times, which makes him an extremely inspiring artist. His work occupies an honorable place in the history of art, offering viewers a multidimensional perspective on reality and inspiring deeper considerations on various aspects of social life, culture and history.`,\n    `Early Years and Education:`,\n    `Mulet entered the world of art almost from the moment he was born, listening to his family's stories about great artistic traditions. Already as a young boy, he showed artistic talents, which resulted in the decision to study art. Graduating from the \"Flechas Navales\" art school in his mother's hometown - Palma de Mallorca, was only a prelude to his education, which he continued, inspired by the greatest artists he had the pleasure of meeting. In 1949, after moving to Algeria, he began a fascinating journey through the world of space and architecture, in the company of architects from different parts of the world, especially Jean-Jaqués Deluz, which had a significant impact on his work and allowed him to express an original view of the world in his works. .`,\n    `Family:`,\n    `In 1956, Antonio García Mulet married Minerva Leon, creating a happy family. The couple had two children: a daughter Elena, also known as Lya, born on June 17, 1957, and a son Antonio, born on June 1, 1960. Their family was an important source of support and inspiration for the artist.`,\n    `Evolution of Creativity:`,\n    `At the age of 30, Antonio García Mulet made a bold decision to move to Paris, which was a breakthrough moment in his artistic life, as he initiated his fascinating adventure with painting. For Mulet, the capital of European art was a period of intense discovery of various artistic trends. It was there that he began to develop his individual style, listening to both tradition and modern artistic expression. There he became an integral part of the local art scene of the era. His work drew inspiration from the achievements of such great artists as Juan Miró and Antonio Saura. In the Abstract Expressionism movement, he found his own unique way to express his unique creativity. His works exuded expression, richness of colors and gestures, which enabled him to convey deep emotions and thoughts through abstract forms.`,\n    `Painting debut:`,\n    `As an experienced painter, Antonio García Mulet debuted at his first exhibition in 1970 in Paris, which marked a significant moment in his artistic career. This event not only gained recognition in the art world, but also opened the door to the fascinating circle of the Dada movement. In this environment he developed close contacts with many other artists of the time, and one of his special friends and admirers of his work was René Char. René Char, a respected poet and philosopher, introduced García Muleta to the Dadaist artistic movement, which allowed him to deepen his understanding of art. It was in this context that he came into direct contact with other great artists, including Juan Miró. Miró showed particular interest in Mulet's work and dedicated to him the words in the book \"Collection d'art UNESCO 10-18\" dated August 5, 1968: \"Para Mulet animańdole para que se lance a fondo\", which can be translated as \"For Mulet - I urge you to devote yourself to it endlessly.\" This dedication was a unique recognition and encouragement to pursue one's artistic passion, and at the same time embodied the spirit of friendship and support in the artistic circles of Paris at that time.”`,\n    `Popularity in Europe:`,\n    `In the 1970s, thanks to Michael Tapié - a renowned art critic, Mulet had the opportunity to present his unique talent and art to a wider audience in Spain through an exhibition at the prestigious Ynganzo gallery in Madrid. This exhibition enabled the artist to exhibit his works in an environment that appreciated his work and created a favorable ground for its further development on the Spanish art scene.`,\n    `Antonio García Mulet has been generously recognized by an international association of artists, curators, critics and collectors, receiving the prestigious Morgan Prize in 1972 at the Ravenna Biennale, Italy. This unique distinction during such a prestigious event was the culminating moment in his artistic career, as well as proof of the huge impact he had on the world of art. This award not only honored Mulet, but also highlighted his significant contributions to the development of abstract art and abstract expressionism on an international scale. Thanks to this appreciation, the artist could enjoy recognition on the international arena, which significantly influenced the further development of his work and position on the world art scene.`,\n    `In 1973, an album titled \"MIRO 80\" was released, a tribute to the outstanding artist Juan Miró on the occasion of his 80th birthday. Antonio García Mulet had the honor of being part of this unique project, where, together with other renowned artists from the world stage, they paid tribute to Miró. As part of this album, Mulet shared his work titled \"Ecce Homo\", which is an acrylic painting on canvas measuring 132 x 91 centimeters. This event was not only an opportunity to honor Miró's achievements, but also to combine the talents of many artists who expressed their respect for the work of this great master of art. The album \"MIRO 80\" has become a unique document of artistic dialogue and tribute to one of the most important artists of the 20th century.`,\n    `25th anniversary of artistic work:`,\n    `As a recognized and respected artist, Antonio García Mulet had the honor to celebrate the 25th anniversary of his fruitful artistic activity at the prestigious Center for Contemporary Art in Noyers sur Serein - Yonne. This event was not only an opportunity to reflect on his long and creative career, but also an opportunity to express thanks for the support and recognition from the art world. It was a unique moment when the artist could share his achievements with a wide audience and continue his fascinating artistic journey that enriched the heritage of contemporary art.`,\n    `Symbolism as the Language of Art:`,\n    `In Mulet's works we find a wealth of signs and symbols that form complex compositions. It is like a hidden language that the artist uses to tell a story about human existence, contemporary problems and the joys of life. Each element has a deeper meaning, which makes Mulet's paintings an interactive journey for the viewer.`,\n    `As a graffiti enthusiast and devoted lover of urban art, he found incredible inspiration in an unconventional source - the silhouette of Mickey Mouse, which could often be seen on the walls of various city buildings. This unusual source inspired him to create his own, unique styling of this character, which became a symbol of his work. It was much more than a simple sign; it was an artistic message that combined transience with significance, suggesting a new way of interpretation. Mulet not only retained the characteristic features of the original character, but also gave them a completely new meaning, which made this artistic signature an inseparable element of his works and left a lasting mark in the world of urban art, fascinating viewers with its originality and creativity.`,\n    `Life as Inspiration:`,\n    `Antonio García Mulet, through his work and activity in the artistic community, influenced the shaping of contemporary art. His works decorate the most important galleries in the world, and his unique style inspires subsequent generations of artists to seek their own expression and a bold approach to art. Apart from art, Mulet is also passionate about life. His travels, meetings with other artists and personal experiences are a constant source of inspiration. The artist is constantly looking for new challenges and forms of expression, unafraid to enter the unknown.`,\n    `Currently:`,\n    `In 2000, Antonio García Mulet made a decisive decision to return to his hometown of Majorca, which was an important stage in his life and artistic career. This symbolic return to his place of birth and roots had a significant impact on his work, inspiring him with new perspectives and places to express himself artistically. Since then, the artist has continued his creative activity and actively engaged in the local and international artistic environment, constantly expanding the horizons of his art. Currently, Antonio García Mulet, together with the renowned Polish artist and friend, Waldemar Kondratowski, is involved in creating a joint artistic project. This artistic collaboration symbolizes their synergistic work, where both artists join forces to create new and fascinating works of art.`,\n    `Antonio García Mulet, distinguished by his unique personality and positive approach to life, managed to gain a wide group of devoted admirers. His openness to new experiences and a deep desire to pass on his artistic vision to future generations led him to create a work called \"Rainbow\". This work becomes a manifesto of his ideas of tolerance and equality, constituting a unique contribution to the developing cultural and artistic discourse of the 21st century. The joint project with Mirella Kurek, who is his friend and supporter, turned out to be not only an artistic challenge, but above all a strong bond between their two individuals. Mirella Kurek became an active promoter of García Muleta's work, which allowed her to reach an even wider audience and convey her artistic message. This artistic partnership, born out of a passion for art and a shared commitment to promoting values ​​such as tolerance and equality, has significantly influenced García Muleta's developing work, proving that art can act not only as an artistic expression, but also as a transmitter of important messages that shape our reality.`,\n    `The life of Antonio García Muleta is like a painting whose every dot and brushstroke is an integral part of a deeper story. His raw expression, rich symbolism and view of modernity made him not only an outstanding artist, but also a philosopher of art. His legacy will continue for generations to come, inspiring reflection and the search for deeper meaning in art and life. Antonio García Mulet is not only a painter, he is a mystic whose works become a call to discover unknown areas of art and the human soul.`\n];\nconst biographyPL = [\n    `Antonio García Mulet: Pełnia Życia, Sztuka jako Refleksja Egzystencji`,\n    `Antonio García Mulet, artysta urodzony 17 listopada 1932 roku w Barcelonie, stanowi niezwykłą postać w historii sztuki współczesnej. Jego życiorys, złożony i pełen fascynujących etapów, jest jak otwarta księga, której strony ilustrują nie tylko artystyczną ewolucję, ale także głęboką filozofię życia. Dzieła Muleta nie tylko odzwierciedlają jego osobiste refleksje, lecz także zawierają delikatne komentarze dotyczące współczesności, co czyni go niezwykle inspirującym artystą. Jego twórczość zajmuje zaszczytne miejsce w historii sztuki, oferując widzom wielowymiarową perspektywę na rzeczywistość i inspirując do głębszych rozważań nad różnorodnymi aspektami życia społecznego, kultury i historii.`,\n    `Wczesne Lata i Edukacja:`,\n    `Mulet wchodził w świat sztuki niemalże od chwili narodzin, zasłuchany w opowieści rodziny o wielkich tradycjach artystycznych. Już jako młody chłopiec okazywał zdolności artystyczne, które zaowocowały decyzją o podjęciu studiów artystycznych. Ukończenie szkoły artystycznej „Flechas Navales” w rodzinnym mieście swojej mamy - Palma de Mallorca to jedynie preludium do jego edukacji, którą kontynuował inspirując się największymi artystami, których miał przyjemność spotkać. W 1949 roku po przeprowadzce do Algierii  rozpoczęła się jego fascynująca podróż  przez świat przestrzeni i architektury, w towarzystwie architektów z różnych stron świata, szczególnie Jean-Jaquésem Deluz, która miała znaczący wpływ na jego twórczość i pozwoliła mu wyrazić oryginalne spojrzenie na świat w swoich dziełach.`,\n    `Rodzina:`,\n    `W roku 1956 Antonio García Mulet poślubił Minervę Leon, tworząc szczęśliwą rodzinę. Para miała dwójkę dzieci: córkę Elenę, znaną również jako Lya, urodzoną 17 czerwca 1957 roku, oraz syna Antonio, który przyszedł na świat 1 czerwca 1960 roku. Ich rodzina była ważnym źródłem wsparcia i inspiracji dla artysty.:`,\n    `Ewolucja Twórczości:`,\n    `Mając 30 lat, Antonio García Mulet podjął odważną decyzję o przeprowadzce do Paryża, co stanowiło przełomowy moment w jego życiu artystycznym, zainicjował bowiem swoją fascynującą przygodę z malarstwem. W stolicy sztuki europejskiej były dla Muleta okresem intensywnego odkrywania różnorodnych nurtów artystycznych. To tam zaczął rozwijać swój indywidualny styl, zasłuchując się zarówno w tradycję, jak i w nowoczesne wyrażenie artystyczne. Stał się tam integralną częścią tamtejszej sceny artystycznej epoki. Jego twórczość czerpała inspirację z dorobku takich wielkich artystów jak Juan Miró i Antonio Saura. W ruchu ekspresjonizmu abstrakcyjnego odnalazł on własny, niepowtarzalny sposób na wyrażenie swojej wyjątkowej kreatywności. Jego dzieła emanowały ekspresją, bogactwem kolorów i gestów, co umożliwiło mu przekazywanie głębokich emocji i myśli za pomocą abstrakcyjnych form.`,\n    `Debiut Malarski:`,\n    `Jako doświadczony malarz, Antonio García Mulet zadebiutował na swojej pierwszej wystawie w 1970 roku w Paryżu, co stanowiło znaczący moment w jego karierze artystycznej. To wydarzenie nie tylko zyskało uznanie w świecie sztuki, ale również otworzyło mu drzwi do fascynującego kręgu ruchu dadaistycznego. W tym środowisku nawiązał bliskie kontakty z wieloma innymi artystami tamtych czasów, a jednym z jego wyjątkowych przyjaciół i wielbicieli jego twórczości był René Char. René Char, ceniony poeta i filozof, wprowadził Garcíę Muleta w kręgi dadaistycznego ruchu artystycznego, co pozwoliło mu na pogłębienie swojego zrozumienia sztuki. To właśnie w tym kontekście nawiązał bezpośredni kontakt z innymi wielkimi artystami, w tym Juanem Miró. Miró okazał szczególne zainteresowanie twórczością Muleta i dedykował mu słowa w książce „Collection d'art UNESCO 10-18” datowane na 5 sierpnia 1968 roku: \"Para Mulet animańdole para que se lance a fondo\", co można przetłumaczyć jako \"Dla Muleta - namawiam Cię, abyś oddał się temu bez końca\". Ta dedykacja stanowiła wyjątkowe uznanie i zachętę do kontynuowania artystycznej pasji, a jednocześnie uosabiała ducha przyjaźni i wsparcia w kręgach artystycznych Paryża tamtych czasów.”`,\n    `Popularność w Europie:`,\n    `W latach 70., dzięki Michael Tapié - uznanemu krytykowi sztuki,  Mulet miał możliwość zaprezentowania swojego unikalnego talentu i sztuki szerszej publiczności w Hiszpanii poprzez wystawę w prestiżowej galerii Ynganzo w Madrycie. Ta ekspozycja umożliwiła artyście eksponowanie swoich dzieł w środowisku, które doceniło jego twórczość i stworzyło dogodny grunt dla jej dalszego rozwoju na hiszpańskiej scenie artystycznej.`,\n    `Antonio García Mulet został hojnie doceniony przez międzynarodowe stowarzyszenie artystów, kuratorów, krytyków i kolekcjonerów, otrzymując w 1972 roku prestiżową Nagrodę Morgana na Biennale w Rawennie, Włochy. To wyjątkowe wyróżnienie podczas tak prestiżowej imprezy była kulminacyjnym momentem w jego karierze artystycznej, a także dowodem na ogromny wpływ, jaki wywarł na świat sztuki. Nagroda ta nie tylko uhonorowała Muleta, ale także podkreśliła jego znaczący wkład w rozwijanie sztuki abstrakcyjnej i ekspresjonizmu abstrakcyjnego na skalę międzynarodową. Dzięki temu docenieniu artysta mógł cieszyć się uznaniem na arenie międzynarodowej, co znacząco wpłynęło na dalszy rozwój jego twórczości oraz pozycję na światowej scenie artystycznej.`,\n    `W 1973 roku ukazał się album zatytułowany \"MIRO 80\", będący wyrazem hołdu dla wybitnego artysty Juana Miró z okazji jego 80. urodzin. Antonio García Mulet miał zaszczyt być częścią tego wyjątkowego projektu, gdzie wspólnie z innymi uznawanymi artystami ze sceny światowej oddali hołd Miró. W ramach tego albumu, Mulet udostępnił swoje dzieło zatytułowane \"Ecce Homo\", będące akrylowym obrazem na płótnie o wymiarach 132 x 91 centymetrów. To wydarzenie było nie tylko okazją do uhonorowania dorobku Miró, ale także połączeniem talentów wielu artystów, którzy wyrazili swoje szacunek wobec twórczości tego wielkiego mistrza sztuki. Album \"MIRO 80\" stał się wyjątkowym dokumentem artystycznego dialogu i hołdu skierowanego ku jednemu z najważniejszych artystów XX wieku.`,\n    `25-lecie pracy artystycznej:`,\n    `Jako uznany i ceniony artysta, Antonio García Mulet miał zaszczyt uczcić 25. rocznicę swojej owocnej działalności artystycznej w prestiżowym Centrum Sztuki Współczesnej w Noyers sur Serein - Yonne. To wydarzenie stanowiło nie tylko okazję do refleksji nad jego długą i twórczą karierą, ale także była okazją do podziękowania za wsparcie i uznanie ze strony świata sztuki. To był wyjątkowy moment, kiedy artysta mógł podzielić się swoim dorobkiem z szeroką publicznością i kontynuować swoją fascynującą podróż artystyczną, która wzbogacała dziedzictwo sztuki współczesnej.`,\n    `Symbolika jako Język Sztuki:`,\n    `W dziełach Muleta odnajdujemy bogactwo znaków i symboli, które układają się w złożone kompozycje. To jakby ukryty język, który artysta używa do opowiedzenia historii o ludzkiej egzystencji, współczesnych problemach i radościach życia. Każdy element ma głębsze znaczenie, co sprawia, że obrazy Muleta stają się interaktywną podróżą dla widza.`,\n    `Jako entuzjasta graffiti i oddany miłośnik sztuki miejskiej, znalazł niesamowitą inspirację w niekonwencjonalnym źródle - sylwetce Myszki Miki, którą często można było spotkać na murach różnych budynków miejskich. To nietypowe źródło zainspirowało go do stworzenia własnej, unikalnej stylizacji tej postaci, która stała się symbolem jego twórczości. To było coś znacznie więcej niż prosty znak; był to przekaz artystyczny, który łączył w sobie ulotność z istotnością, sugerując nowy sposób interpretacji. Mulet nie tylko zachował charakterystyczne cechy oryginalnej postaci, ale także nadał im zupełnie nowe znaczenie, co uczyniło tę artystyczną sygnaturę nieodłącznym elementem jego dzieł i pozostawiło trwały ślad w świecie sztuki miejskiej, fascynując widzów swoją oryginalnością i kreatywnością.`,\n    `Życie jako Inspiracja:`,\n    `Antonio García Mulet, poprzez swoją twórczość i aktywność w środowisku artystycznym, wpłynął na kształtowanie współczesnej sztuki. Jego prace zdobią najważniejsze galerie świata, a jego unikalny styl inspiruje kolejne pokolenia artystów do poszukiwania własnego wyrazu i odważnego podejścia do sztuki. Poza sztuką, Mulet jest również pasjonatem życia. Jego podróże, spotkania z innymi artystami i doświadczenia osobiste stanowią nieustające źródło inspiracji. Artysta nieustannie poszukuje nowych wyzwań i form wyrazu, nie bojąc się wchodzić w nieznane.`,\n    `Obecnie:`,\n    `W roku 2000, Antonio García Mulet podjął zdecydowaną decyzję o powrocie w rodzinne strony na Majorkę, co stanowiło istotny etap w jego życiu i karierze artystycznej. To symboliczne wrócenie do swojego miejsca urodzenia i korzeni miało znaczący wpływ na jego twórczość, inspirując go nowymi perspektywami i miejscami do wyrażenia siebie artystycznie. Od tamtego czasu, artysta kontynuował swoją aktywność twórczą, a także włączył się aktywnie w lokalne i międzynarodowe środowisko artystyczne, stale poszerzając horyzonty swojej sztuki. W obecnej chwili, Antonio García Mulet wspólnie z uznawanym polskim artystą i przyjacielem, Waldemarem Kondratowskim, angażuje się w tworzenie wspólnego projektu artystycznego. Ta kooperacja artystyczna symbolizuje ich synergiczną pracę, gdzie obaj artyści łączą siły, aby tworzyć nowe i fascynujące dzieła sztuki.`,\n    `Antonio García Mulet, wyróżniający się swoją wyjątkową osobowością oraz pozytywnym podejściem do życia, zdołał zyskać szerokie grono oddanych wielbicieli. Jego otwartość na nowe doświadczenia i głęboka chęć przekazania swojej artystycznej wizji przyszłym pokoleniom skłoniły go do tworzenia dzieła o nazwie \"Tęcza\". To dzieło staje się manifestem jego idei tolerancji i równości, stanowiąc wyjątkowy wkład w rozwijający się dyskurs kulturowy i artystyczny XXI wieku. Wspólny projekt z Mirellą Kurek, która jest jego przyjaciółką i wsparciem, okazał się nie tylko artystycznym wyzwaniem, ale przede wszystkim silnym więzią łączącą ich dwie indywidualności. Mirella Kurek stała się aktywnym promotorem twórczości Garcíi Muleta, co pozwoliło na dotarcie do jeszcze szerszej publiczności i przekazanie przesłania artystycznego. To partnerstwo artystyczne, zrodzone z pasji do sztuki i wspólnego zaangażowania w promowanie wartości, takich jak tolerancja i równość, wpłynęło istotnie na rozwijającą się twórczość Garcíi Muleta, dowodząc, że sztuka może pełnić rolę nie tylko wyrazu artystycznego, ale także przekaźnika ważnych przesłań kształtujących naszą rzeczywistość.`,\n    `Życie Antonio García Muleta jest niczym obraz, którego każda kropka i pociągnięcie pędzla stanowi integralną część głębszej opowieści. Jego surowa ekspresja, bogata symbolika i spojrzenie na współczesność uczyniły go nie tylko wybitnym artystą, lecz także filozofem sztuki. Jego dziedzictwo będzie kontynuowane przez kolejne pokolenia, inspirując do refleksji i poszukiwania głębszego sensu w sztuce i życiu. Antonio García Mulet to nie tylko malarz, to mistyk, którego dzieła stają się wezwaniem do odkrywania nieznanych obszarów sztuki i ludzkiej duszy.`\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/biographyData.tsx\n");

